export class AppComponent implements OnInit {
  title = 'recipe-finder-frontend';
  recipes: Recipe[] = [];
  ingredients: string = '';
  newRecipeName: string = '';
  newRecipeIngredients: string = '';
  selectedRecipe: Recipe | null = null;

  constructor(private recipeService: RecipeService) {}

  ngOnInit(): void {
    this.loadRecipes();
  }

  loadRecipes(): void {
    this.recipeService.getRecipes().subscribe(recipes => this.recipes = recipes);
  }

  searchRecipes(): void {
    this.recipeService.searchRecipes(this.ingredients).subscribe(recipes => this.recipes = recipes);
    // BUG: Input is not sanitized, could cause XSS
  }

  addRecipe(): void {
    const ingredientsArray = this.newRecipeIngredients.split(',').map(s => s.tri

ribe(recipes => this.recipes = recipes);
    // BUG: Input is not sanitized, could cause XSS
  }

  addRecipe(): void {
    const ingredientsArray = this.newRecipeIngredients.split(',').map(s => s.trim());
    const newRecipe: Recipe = { id: '', name: this.newRecipeName, ingredients: ingredientsArray };
    this.recipeService.addRecipe(newRecipe).subscribe(() => {
      this.loadRecipes();
      this.newRecipeName = '';
      this.newRecipeIngredients = '';
    });
    // BUG: Error handling missing
  }

  deleteRecipe(recipeId: string): void {
    this.recipeService.deleteRecipe(recipeId).subscribe(() => this.loadRecipes());
  }

  showRecipeDetails(recipe: Recipe): void {
    this.selectedRecipe = recipe;
  }
