# Weather App

A simple weather application built with React and Flask. Allows users to search for the current weather conditions in any city.

## Features

*   Displays current temperature, humidity, and weather description.
*   Search functionality for any city.
*   Responsive design.

## Technologies Used

*   Frontend: React
*   Backend: Flask (Python)
*   Weather API: OpenWeatherMap
# Local Development Setup

## Backend (Flask)

1.  Navigate to the backend directory:
    ```bash
    cd backend
    ```
2.  Create a virtual environment:
    ```bash
    python -m venv venv
    ```
3.  Activate the virtual environment:
    *   On Windows:
        ```bash
        venv\Scripts\activate
        ```
    *   On macOS and Linux:
        ```bash
        source venv/bin/activate
        ```
4.  Install dependencies:
    ```bash
    pip install -r requirements.txt
    ```
5.  Set the OpenWeatherMap API key as an environment variable:
    ```bash
    export WEATHER_API_KEY=YOUR_API_KEY
    ```
6.  Run the Flask application:
    ```bash
    python app.py
    ```

## Frontend (React)

1.  Navigate to the frontend directory:
    ```bash
    cd frontend
    ```
2.  Install dependencies:
    ```bash
    npm install
    ```
3.  Start the React development server:
    ```bash
    npm start
    ```

## Accessing the Application

Open your web browser and navigate to `http://localhost:3
:
    ```bash
    npm install
    ```
3.  Start the React development server:
    ```bash
    npm start
    ```

## Accessing the Application

Open your web browser and navigate to `http://localhost:3000` to access the React frontend.
The Flask backend will be running on `http://localhost:5000`.
