# Architecture Document

## Overview

This document outlines the architecture of the Task Management System.

## Frontend

*   Technology: React
*   Responsibility: Handles the user interface, user interactions, and communication with the backend API.

## Backend

*   Technology: Python FastAPI
*   Responsibility: Manages task data, handles API requests from the frontend, and performs business logic.

## Data Storage

*   Technology: In-memory (for this demonstration).
*   Responsibility: Stores task data (task descriptions and completion statuses).
# API Endpoints

## Task Management System API Endpoints

| Method | Endpoint        | Description                                      | Request Body                                         | Response Body                                        |
| ------ | --------------- | ------------------------------------------------ | ---------------------------------------------------- | ---------------------------------------------------- |
| GET    | /tasks          | Retrieves a list of all tasks.                   | None                                                 | List of Task objects (JSON)                          |
| POST   | /tasks          | Creates a new task.                              | Task object (JSON: description, completed)          | Task object (JSON: id, description, completed)      |
| GET    | /tasks/{task_id} | Retrieves a specific task by ID.                 | None                                                 | Task object (JSON: id, description, completed)  
mpleted)      |
| GET    | /tasks/{task_id} | Retrieves a specific task by ID.                 | None                                                 | Task object (JSON: id, description, completed)      |
| PUT    | /tasks/{task_id} | Updates an existing task by ID.                  | Task object (JSON: description, completed)          | Task object (JSON: id, description, completed)      |
| DELETE | /tasks/{task_id} | Deletes a task by ID.                              | None                                                 | JSON: {"message": "Task deleted"}                     |

## Task Object

```json
{
  "id": 1,           // (Integer, optional for POST)
  "description": "Grocery Shopping", // (String, required)
  "completed": false  // (Boolean, optional, defaults to false)
}
```

